●内容量:25gx12シート。●標準除湿量(水換算):1シートあたり(約)50g(温度25℃、湿度80％の場合)。●成分:塩化カルシウム、保水剤、防カビ剤、消臭剤。●使用期間:3～4ヶ月(同じ使用場所でも季節や湿度の状態で異なります)。●使用基準:たんすの引き出し・衣装箱50L(約50x40x25cm)に1シートを目安にお使いください。 ●DCMカーマ、DCMダイキ、DCMホーマック、DCMサンワ全国展開ホームセンターDCMグループのオリジナル商品です！●すばやく湿気を取り、ゼリー状に固めることで液モレの心配をせず除湿効果を確認できます。●防カビ剤・消臭剤配合です。●引き出しに最適な大きさの除湿剤です。●防虫剤と一緒に使えます。 ●薬剤袋に傷つけたり、破いたり、油や洗剤などで汚したりしないようご注意ください。また、薬剤の中を取り出さないでください。●薬剤を飲んだりなめたりした場合は、水を多量に飲ませるか、吐かせてください。また、目に入った場合は、すぐに多量の水で洗い流してください。どちらの場合も万一異常があれば医師にご相談ください。●特に湿気の多い場合、一時的に薬剤がゼリー状にならず液体がたまることがありますが、効果には影響ありませんのでそのままご使用ください。<style type="text/css">
